// ============================================================================
// CONSTEXPR INPUT PARSING (only parsing, no computation)
// ============================================================================

struct Range {
    long long lo, hi;
};

constexpr std::pair<long long, int> parse_number(const char* s, int pos) {
    long long val = 0;
    while (s[pos] >= '0' && s[pos] <= '9') {
        val = val * 10 + (s[pos] - '0');
        pos++;
    }
    return {val, pos};
}

constexpr int count_ranges(const char* s) {
    int count = 0, i = 0;
    while (s[i] != '\0') {
        if (s[i] == '\n' && s[i+1] == '\n') break;
        if (s[i] == '\n') count++;
        i++;
    }
    return count + 1;
}

constexpr int count_ids(const char* s) {
    int i = 0;
    while (s[i] != '\0' && !(s[i] == '\n' && s[i+1] == '\n')) i++;
    if (s[i] == '\0') return 0;
    i += 2;
    int count = 0;
    while (s[i] != '\0') {
        if (s[i] >= '0' && s[i] <= '9') {
            count++;
            while (s[i] >= '0' && s[i] <= '9') i++;
        } else i++;
    }
    return count;
}

template<int N>
constexpr std::array<Range, N> parse_ranges(const char* s) {
    std::array<Range, N> ranges{};
    int pos = 0;
    for (int i = 0; i < N; i++) {
        auto [lo, p1] = parse_number(s, pos);
        pos = p1 + 1;
        auto [hi, p2] = parse_number(s, pos);
        pos = p2 + 1;
        ranges[i] = {lo, hi};
    }
    return ranges;
}

template<int N>
constexpr std::array<long long, N> parse_ids(const char* s) {
    std::array<long long, N> ids{};
    int pos = 0;
    while (s[pos] != '\0' && !(s[pos] == '\n' && s[pos+1] == '\n')) pos++;
    pos += 2;
    for (int i = 0; i < N; i++) {
        while (s[pos] == '\n') pos++;
        auto [val, p] = parse_number(s, pos);
        ids[i] = val;
        pos = p + 1;
    }
    return ids;
}

// Parsed data as constexpr arrays
constexpr int NUM_RANGES = count_ranges(INPUT_STR);
constexpr int NUM_IDS = count_ids(INPUT_STR);
constexpr auto RANGES = parse_ranges<NUM_RANGES>(INPUT_STR);
constexpr auto IDS = parse_ids<NUM_IDS>(INPUT_STR);
